import React from "react";

const Login = ({ isSignup = false }) => {
    return <div>{isSignup ? <div>hello</div> :
        <div className="flex flex-col items-center">
            <span>Login</span>

        </div>
    }
    </div>;
};

Login.prototype = {
    isSignup: Boolean,
};

export default Login;
